/*Table structure for table `db_article_share_log` */

DROP TABLE IF EXISTS `db_article_share_log`;

CREATE TABLE `db_article_share_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '用户id',
  `count` int(5) DEFAULT '1' COMMENT '分享次数',
  `article_id` int(11) DEFAULT '1' COMMENT '关联推文',
  `add_time` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推文微信分享记录';

/*Data for the table `db_article_share_log` */

/*Table structure for table `db_article_tweet` */

DROP TABLE IF EXISTS `db_article_tweet`;

CREATE TABLE `db_article_tweet` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL,
  `img` varchar(100) DEFAULT NULL COMMENT '图片',
  `imgs_a` varchar(1024) DEFAULT NULL COMMENT '多图',
  `content` text,
  `auid` int(11) DEFAULT '0',
  `tui_article` varchar(20) DEFAULT NULL COMMENT '关联推荐文章',
  `tui_goods` varchar(20) DEFAULT NULL COMMENT '关联推荐产品',
  `is_check` tinyint(1) DEFAULT '0' COMMENT '是否审核,1是,0否',
  `page_view` int(10) DEFAULT '0' COMMENT '浏览量',
  `author` varchar(25) DEFAULT NULL,
  `add_time` int(11) DEFAULT NULL,
  `type` tinyint(1) DEFAULT '0' COMMENT '文章类型:0普通文章,1活动文章',
  `goods_id` int(11) DEFAULT '0' COMMENT '活动商品id',
  `share_num` int(6) DEFAULT '0' COMMENT '分享次数',
  `goods_num` int(4) DEFAULT '0' COMMENT '活动数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='佣金推文';

/*Data for the table `db_article_tweet` */

/*Table structure for table `db_bank_account` */

DROP TABLE IF EXISTS `db_bank_account`;

CREATE TABLE `db_bank_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL COMMENT '会员id',
  `type` tinyint(1) DEFAULT '1' COMMENT '账户类型 1提现申请 2旗舰店或办事处',
  `shop_id` int(11) DEFAULT '0' COMMENT '商家id',
  `blank_id` int(11) DEFAULT '0' COMMENT '所属银行  关联银行bank_id',
  `account_bank` varchar(32) NOT NULL COMMENT '所属银行名称',
  `account_no` varchar(32) NOT NULL COMMENT '银行卡号',
  `account_name` varchar(50) NOT NULL COMMENT '开户户名',
  `ID_card` varchar(18) DEFAULT NULL COMMENT '用户身份证号码',
  `account_addr` varchar(100) DEFAULT NULL COMMENT '开户行分行地址',
  `is_default` tinyint(3) DEFAULT '0' COMMENT '是否为默认 1是0否',
  `is_del` tinyint(3) DEFAULT '0' COMMENT '是否删除1 已删除 0未删除',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_tb_bank_account_01` (`member_id`),
  KEY `idx_tb_bank_account_02` (`account_no`),
  KEY `idx_tb_bank_account_03` (`add_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='银行账户信息';

/*Data for the table `db_bank_account` */

/*Table structure for table `db_base` */

DROP TABLE IF EXISTS `db_base`;

CREATE TABLE `db_base` (
  `base_id` mediumint(8) NOT NULL AUTO_INCREMENT COMMENT '基地id',
  `base_name` varchar(75) DEFAULT NULL COMMENT '基地名称',
  `base_logo` varchar(200) DEFAULT NULL COMMENT '基地图片',
  `base_order` smallint(4) DEFAULT '0' COMMENT '属性显示的顺序，数字越大越靠前 ，如果数字一样则按id顺序',
  `is_shelves` tinyint(1) DEFAULT '0' COMMENT '状态：1正常 0未签约',
  `pledge_money` decimal(12,2) DEFAULT '0.00' COMMENT '保证金',
  `base_points` float DEFAULT NULL COMMENT '基地可赠送积分数',
  PRIMARY KEY (`base_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基地信息表';

/*Data for the table `db_base` */

/*Table structure for table `db_base_log` */

DROP TABLE IF EXISTS `db_base_log`;

CREATE TABLE `db_base_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '赠送积分id',
  `base_id` int(11) NOT NULL DEFAULT '0' COMMENT '基地id',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `integral` int(6) NOT NULL DEFAULT '0' COMMENT '赠送积分',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '赠送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='基地赠送积分记录';

/*Data for the table `db_base_log` */

/*Table structure for table `db_blank` */

DROP TABLE IF EXISTS `db_blank`;

CREATE TABLE `db_blank` (
  `blank_id` int(11) NOT NULL AUTO_INCREMENT,
  `blank_name` varchar(50) DEFAULT NULL,
  `status` tinyint(3) DEFAULT NULL,
  `is_del` tinyint(3) DEFAULT '0' COMMENT '是否删除0 未删除 1已删除',
  PRIMARY KEY (`blank_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;

