/*Table structure for table `db_cash_apply` */

DROP TABLE IF EXISTS `db_cash_apply`;

CREATE TABLE `db_cash_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cash_sn` varchar(20) DEFAULT NULL COMMENT '提现单号',
  `openid` varchar(32) DEFAULT NULL COMMENT '提现用户openid',
  `member_id` int(11) DEFAULT NULL COMMENT '会员id',
  `shop_id` int(11) DEFAULT NULL,
  `bank_account_id` int(11) DEFAULT '0' COMMENT '提现帐号id',
  `blank_id` int(11) DEFAULT '0',
  `account_bank` varchar(20) NOT NULL COMMENT '所属银行',
  `account_no` varchar(32) NOT NULL COMMENT '银行卡号',
  `account_name` varchar(50) NOT NULL COMMENT '开户户名',
  `account_addr` varchar(100) DEFAULT NULL COMMENT '开户行地址',
  `money` decimal(14,2) DEFAULT NULL COMMENT '提现金额',
  `cash_fee` decimal(14,2) DEFAULT NULL COMMENT '提现手续费',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '提交时间',
  `type` tinyint(5) DEFAULT '1' COMMENT '1商家提现 2会员提现',
  `status` tinyint(5) DEFAULT '1' COMMENT '状态 0 拒绝提现  1提现申请中 2财务打款中 3已提现',
  `auid1` int(11) DEFAULT '0' COMMENT '第一步操作员',
  `auid_status1` tinyint(4) DEFAULT '0' COMMENT '1同意 2拒绝',
  `remarks1` varchar(200) DEFAULT NULL COMMENT '第一步备注',
  `op_time1` int(11) DEFAULT '0' COMMENT '第一步操作时间',
  `auid2` int(11) DEFAULT '0' COMMENT '第2步操作员 财务处',
  `auid_status2` tinyint(4) DEFAULT '0' COMMENT '1同意 2拒绝',
  `remarks2` varchar(200) DEFAULT NULL COMMENT '第2步备注',
  `op_time2` int(11) DEFAULT '0' COMMENT '第二步操作时间',
  `payment_no` varchar(32) DEFAULT NULL COMMENT '汇款交易号 1,微信提现',
  `imgpath` varchar(150) DEFAULT NULL COMMENT '汇款照片',
  PRIMARY KEY (`id`),
  KEY `idx_tb_cash_apply_01` (`member_id`) USING BTREE,
  KEY `idx_tb_cash_apply_02` (`account_no`) USING BTREE,
  KEY `idx_tb_cash_apply_03` (`add_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='提现申请记录';

/*Data for the table `db_cash_apply` */

