/*Table structure for table `db_city_city` */

DROP TABLE IF EXISTS `db_city_city`;

CREATE TABLE `db_city_city` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cityid` int(11) NOT NULL,
  `city` varchar(20) NOT NULL,
  `fatherid` int(11) NOT NULL,
  `first` char(3) DEFAULT NULL COMMENT '首字母',
  `hot` tinyint(3) DEFAULT '0' COMMENT '热门城市 1是 0否',
  `is_capital` tinyint(1) DEFAULT '0' COMMENT '是否是省会 1是 0不是',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=346 DEFAULT CHARSET=utf8 COMMENT='城市信息';

