/*Table structure for table `db_draw_address` */

DROP TABLE IF EXISTS `db_draw_address`;

CREATE TABLE `db_draw_address` (
  `address_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `draw_log_id` int(11) DEFAULT '0' COMMENT '中奖记录id',
  `member_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `address_name` varchar(50) NOT NULL DEFAULT '' COMMENT '收货地址省市区',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的名字',
  `email` varchar(60) DEFAULT '',
  `address` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的详细地址',
  `zipcode` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的邮编',
  `tel` varchar(60) DEFAULT '' COMMENT '收货人的电话',
  `mobile` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的手机',
  `sign_building` varchar(120) NOT NULL DEFAULT '' COMMENT '收货地址的标志性建筑名',
  `best_time` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的最佳收货时间',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态0奖品待发货  1 奖品已发货',
  `invoice_no` varchar(100) DEFAULT NULL COMMENT '发货单号',
  `invoice_time` int(10) DEFAULT '0' COMMENT '发货时间',
  PRIMARY KEY (`address_id`),
  KEY `user_id` (`member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='商品奖品收货信息';

/*Data for the table `db_draw_address` */

/*Table structure for table `db_draw_log` */

DROP TABLE IF EXISTS `db_draw_log`;

CREATE TABLE `db_draw_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '用户id',
  `draw_id` int(11) DEFAULT '0' COMMENT '奖品id',
  `draw_type` tinyint(2) DEFAULT '0' COMMENT '奖品类型',
  `draw_value` varchar(10) DEFAULT '0' COMMENT '奖品值',
  `log_status` tinyint(1) DEFAULT '1' COMMENT '中奖状态0无效 1未到账 2处理中 5已到帐',
  `add_time` int(10) DEFAULT '0' COMMENT '抽奖时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='抽奖记录';

/*Data for the table `db_draw_log` */

/*Table structure for table `db_draw_progressive` */

DROP TABLE IF EXISTS `db_draw_progressive`;

CREATE TABLE `db_draw_progressive` (
  `id` int(6) NOT NULL AUTO_INCREMENT,
  `draw_type` tinyint(3) DEFAULT '1' COMMENT '奖品类型 1积分 2金币 3话费4折扣5商品',
  `draw_value` varchar(10) DEFAULT '0' COMMENT '参数值 类型为商品时此值为商品id 为 积分 金币 话费 折扣时值为设置的值',
  `draw_chances_value` int(6) DEFAULT '0' COMMENT '中奖概率',
  `draw_status` tinyint(1) DEFAULT '0' COMMENT '有效性 1有效 0无效',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  `is_shenghe` tinyint(1) DEFAULT '0' COMMENT '是否审核 1已审核 0未审核',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='抽奖奖池';

/*Data for the table `db_draw_progressive` */

/*Table structure for table `db_draw_recharge` */

DROP TABLE IF EXISTS `db_draw_recharge`;

CREATE TABLE `db_draw_recharge` (
