  `mobile` varchar(15) DEFAULT NULL COMMENT '手机号',
  `draw_log_id` int(11) DEFAULT '0' COMMENT '抽奖记录id',
  `draw_value` varchar(10) DEFAULT '0' COMMENT '奖品值',
  `status` tinyint(1) DEFAULT '1' COMMENT '中奖状态0无效 1未到账 2处理中 5已到帐',
  `add_time` int(10) DEFAULT '0' COMMENT '抽奖时间',
