/*Table structure for table `db_g_attribute` */

DROP TABLE IF EXISTS `db_g_attribute`;

CREATE TABLE `db_g_attribute` (
  `attr_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `cat_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '商品分类id',
  `attr_name` varchar(60) NOT NULL DEFAULT '' COMMENT '属性名称',
  `attr_input_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '当添加商品时，该属性的添 加类别；0，为手工输入；1，为选择输入；2，为多行文本输入',
  `attr_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '属性是否多选；0，否；1，是；如 果可以多选，则可以自定义属性，并且可以根据值的不同定不同的价',
  `attr_values` text NOT NULL COMMENT '如果attr_input_type为1，即选择输入，则attr_name对应的值 的取值就是该字段的值',
  `attr_index` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '属性是否可以检索；0，不需要检 索；1，关键字检索；2，范围检索；该属性应该是如果检索的话，可以通过该属性找到有该属性的商 品',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '属性显示的顺序，数字越大越靠前 ，如果数字一样则按id顺序',
  `is_linked` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否关联；0，不关联；1，关联； 如果关联，那么用户在购买该商品时，具有有该属性相同值的商品将被推荐给用户',
  `attr_group` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '属性分组，相同的为一个属性组。 该值应该取自goods_type的attr_group的值的顺序',
  `is_package` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是套餐属性  1 是 0不是',
  PRIMARY KEY (`attr_id`),
  KEY `cat_id` (`cat_id`)
) ENGINE=MyISAM AUTO_INCREMENT=262 DEFAULT CHARSET=utf8 COMMENT='商品类型属性表，该表记录的 是每个商品类型的所有属性的配置情';

/*Data for the table `db_g_attribute` */

