CREATE TABLE `db_g_booking_goods` (
  `rec_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '登记该缺货记录的用户的id',
  `email` varchar(60) NOT NULL DEFAULT '' COMMENT ' 页面填的用户的email，',
  `link_man` varchar(60) NOT NULL DEFAULT '' COMMENT '页面填的用户的姓名',
  `tel` varchar(60) NOT NULL DEFAULT '' COMMENT '页面填的用户的电话',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '缺货登记时留的订购描述',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '订购数量',
  `booking_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '缺货登记的时间',
  `is_dispose` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否已经被处理',
  `dispose_user` varchar(30) NOT NULL DEFAULT '' COMMENT '处理该缺货登记的管理员用户名，取值于session,该 session取值于ecs_admin_user的user_name',
  `dispose_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '处理的时间',
  `dispose_note` varchar(255) NOT NULL DEFAULT '' COMMENT '处理时管理员留的备注',
  PRIMARY KEY (`rec_id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='缺货登记的订购和处理记录表';

