  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_sn` varchar(60) NOT NULL DEFAULT '',
  `product_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品的名称',
  `goods_img` varchar(120) DEFAULT NULL,
  `market_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品的市场价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的本店价，',
  `share_money` decimal(5,2) DEFAULT '0.00' COMMENT '分享返利金额',
  `share_card` char(10) DEFAULT NULL COMMENT '分享者 card',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '商品的购买数量',
  `shipping_money` decimal(6,2) DEFAULT '0.00' COMMENT '运费 0表示包邮 ',
  `goods_attr` text NOT NULL COMMENT '商品的属性，中括号里是该属性特有的价格',
  `is_real` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '取自ecs_goods的is_rea',
  `extension_code` varchar(30) NOT NULL DEFAULT '' COMMENT '商品的扩展属性，取自ecs_goods的 extension_code',
