/*Table structure for table `db_g_category` */

DROP TABLE IF EXISTS `db_g_category`;

CREATE TABLE `db_g_category` (
  `cat_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `cat_name` varchar(90) NOT NULL DEFAULT '' COMMENT '分类名称',
  `cat_icon` varchar(100) DEFAULT NULL COMMENT '分类图片',
  `keywords` varchar(255) NOT NULL DEFAULT '' COMMENT '分类的关键字',
  `goods_sn` char(10) DEFAULT NULL COMMENT '商品货号前缀',
  `cat_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '分类描述',
  `parent_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '该分类的父id，取值于该表的 cat_id字段',
  `sort_order` tinyint(1) unsigned NOT NULL DEFAULT '50' COMMENT '该分类在页面显示的顺序，数字越 大顺序越靠后；同数字，id在前的先显示',
  `measure_unit` varchar(15) NOT NULL DEFAULT '' COMMENT '该分类的计量单位',
  `need_check` tinyint(1) DEFAULT '0' COMMENT '是否需要审核 用户公司 0不需要 1需要',
  `show_in_nav` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示在导航栏，0，不；1，显示在导航 栏',
  `style` varchar(150) NOT NULL COMMENT '该分类的单独的样式表的包括文件名部分的文件路径',
  `is_exhibition` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否在首页陈列，1，显示；0， 不显示',
  `is_show` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否在前台页面显示，1，显示；0， 不显示',
  `grade` tinyint(4) NOT NULL DEFAULT '0' COMMENT '该分类的最高和最低价之间的价格分级，当大于1 时，会根据最大最小价格区间分成区间，会在页面显示价格范围，如0-300,300-600,600-900这种',
  PRIMARY KEY (`cat_id`),
  KEY `parent_id` (`parent_id`)
) ENGINE=MyISAM AUTO_INCREMENT=129 DEFAULT CHARSET=utf8 COMMENT='商品分类表，记录商品分类信 息';

