/*Table structure for table `db_g_goods` */

DROP TABLE IF EXISTS `db_g_goods`;

CREATE TABLE `db_g_goods` (
  `goods_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `cat_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '商品所属商品分类id',
  `goods_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '商品的唯一货号',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品的名称',
  `subtitle` varchar(200) DEFAULT '' COMMENT '子标题(噱头)',
  `feeling` varchar(255) DEFAULT '' COMMENT '情怀 ',
  `goods_name_style` varchar(60) NOT NULL DEFAULT '+' COMMENT '商品名称显示的样式；包括颜色和字 体样式；格式如#ff00ff+strong',
  `click_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品点击数',
  `brand_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '品牌id，取值于ecs_brand 的 brand_id',
  `provider_name` varchar(100) NOT NULL DEFAULT '' COMMENT '供货人的名称，程序还没实现该功能',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '商品库存数量',
  `goods_weight` decimal(10,3) unsigned NOT NULL DEFAULT '0.000' COMMENT '商品的重量，以千克为 单位',
  `unit_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '商品单价',
  `units` varchar(20) DEFAULT NULL COMMENT '商品单位',
  `shipping_money` decimal(10,2) DEFAULT '0.00' COMMENT '运费 0表示包邮 ',
  `shipping_id` int(5) DEFAULT '0' COMMENT '运送方式ID,取决于g_shipping表',
  `purchase_price` decimal(10,2) DEFAULT '0.00' COMMENT '进价',
  `market_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '市场售价',
  `shop_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '本店售价',
  `gift_integral` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '购买送积分',
  `vip_price` decimal(10,2) DEFAULT '0.00' COMMENT 'vip 价格',
  `share_money` decimal(5,2) DEFAULT '0.00' COMMENT '分享返利',
  `activity_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '促销价格',
  `activity_start_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销价格开始日期',
  `activity_end_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销价结束日期',
  `activity_img` varchar(100) DEFAULT NULL COMMENT '促销图片',
  `warn_number` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '商品报警数量',
  `keywords` varchar(255) NOT NULL DEFAULT '' COMMENT '商品关键字，放在商品页的关键字中，为搜索引擎收录 用',
  `goods_brief` varchar(255) NOT NULL DEFAULT '' COMMENT '商品的简短描述',
  `goods_desc` text NOT NULL COMMENT '商品的详细描述',
  `goods_thumb` varchar(255) NOT NULL DEFAULT '' COMMENT '商品在前台显示的微缩图片，如在分类筛选时显示的小 图片',
  `long_goods_img` varchar(255) DEFAULT NULL COMMENT '(优先于goods_img)商品的实际大小图片，如进入该商品页时介绍商品属性所 显示的大图片',
  `goods_img` varchar(255) NOT NULL DEFAULT '' COMMENT '商品的实际大小图片，如进入该商品页时介绍商品属性所 显示的大图片',
  `original_img` varchar(255) NOT NULL DEFAULT '' COMMENT '应该是上传的商品的原始图片',
  `is_real` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否是实物，1，是；0，否；比如虚 拟卡就为0，不是实物',
  `extension_code` varchar(30) NOT NULL DEFAULT '' COMMENT '商品的扩展属性，比如像虚拟卡',
  `is_on_sale` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '该商品是否开放销售，1，是；0， 否',
  `is_alone_sale` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否能单独销售，1，是；0， 否；如果不能单独销售，则只能作为某商品的配件或者赠品销售',
  `is_shipping` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `offline` tinyint(1) DEFAULT '0' COMMENT '货到付款',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '购买该商品可以使用的积分数量，估计 应该是用积分代替金额消费；【预留】',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `sort_order` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '应该是商品的显示顺序，',
  `is_upgrade` tinyint(1) DEFAULT '0' COMMENT '升级产品',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品是否已经删除，0，否；1，已 删除',
