/*Table structure for table `db_g_goods_attr` */

DROP TABLE IF EXISTS `db_g_goods_attr`;

CREATE TABLE `db_g_goods_attr` (
  `goods_attr_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '该具体属性属于的商品',
  `attr_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '该具体属性属于的属性类型的id',
  `attr_value` text NOT NULL COMMENT ' 该具体属性的值',
  `attr_price` varchar(255) NOT NULL DEFAULT '' COMMENT '该属性对应在商品原价格上要加的价格',
  `attr_vip_price` varchar(20) DEFAULT NULL COMMENT 'vip 属性价格',
  `attr_share_money` varchar(20) DEFAULT '' COMMENT '该属性的分享价格',
  `is_package` tinyint(1) DEFAULT '0' COMMENT '是否是套餐属性',
  PRIMARY KEY (`goods_attr_id`),
  KEY `goods_id` (`goods_id`),
  KEY `attr_id` (`attr_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='具体商品的属性表';

/*Data for the table `db_g_goods_attr` */

/*Table structure for table `db_g_goods_gallery` */

DROP TABLE IF EXISTS `db_g_goods_gallery`;

CREATE TABLE `db_g_goods_gallery` (
  `img_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '实际图片url',
  `img_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '图片说明信息',
  `thumb_url` varchar(255) NOT NULL DEFAULT '',
  `img_original` varchar(255) NOT NULL DEFAULT '',
  `img_order` smallint(4) DEFAULT '0' COMMENT '属性显示的顺序，数字越大越靠前 ，如果数字一样则按id顺序',
  PRIMARY KEY (`img_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品相册表，只出现在页面的 商品相册中';

/*Data for the table `db_g_goods_gallery` */

/*Table structure for table `db_g_goods_type` */

DROP TABLE IF EXISTS `db_g_goods_type`;

CREATE TABLE `db_g_goods_type` (
  `cat_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `cat_name` varchar(60) NOT NULL DEFAULT '' COMMENT '商品类型名',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '类型状态，1，为可用；0为不可用； 不可用的类型，在添加商品的时候选择商品属性将不可选',
  `attr_group` varchar(255) NOT NULL COMMENT '商品属性分组，将一个商品类型的属性分成组，在显示 的时候也是按组显示。该字段的值显示在属性的前一行，像标题的作用',
  PRIMARY KEY (`cat_id`)
) ENGINE=MyISAM AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='商品类型表，该表每条记录就 是一个商品类型';

/*Data for the table `db_g_goods_type` */

/*Table structure for table `db_g_order_action` */

DROP TABLE IF EXISTS `db_g_order_action`;

CREATE TABLE `db_g_order_action` (
  `action_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '被操作的交易号',
  `action_user` varchar(30) NOT NULL DEFAULT '' COMMENT '操作该次的人员',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '作何操作.0，未确认；1，已确 认；2，已取消；3，无效；4，退货；',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '发货状态。0，未发货；1， 已发货；2，已收货；3，备货中',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT ' 支付状态.0,未付款;1,付款中;2, 已付款;',
  `action_place` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `action_note` varchar(255) NOT NULL DEFAULT '' COMMENT '操作备注',
  `log_time` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`action_id`),
  KEY `order_id` (`order_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='订单操作日志表';

/*Data for the table `db_g_order_action` */

/*Table structure for table `db_g_order_goods` */

DROP TABLE IF EXISTS `db_g_order_goods`;

CREATE TABLE `db_g_order_goods` (
  `rec_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品的名称',
  `goods_image` varchar(120) DEFAULT NULL,
  `goods_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '商品的唯一货号',
  `product_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '商品的购买数量',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的市场售价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的本店售价',
  `gift_integral` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '购物赠送积分',
  `share_card` char(10) DEFAULT NULL COMMENT '分享者 card',
  `shipping_money` decimal(6,2) DEFAULT '0.00' COMMENT ' 运费 0表示包邮 ',
  `goods_attr` text NOT NULL COMMENT '购买该商品时所选择的属性；',
  `goods_shipping` varchar(30) DEFAULT NULL COMMENT '包邮方式 默认SF顺风包邮',
  `shipping_code` varchar(20) DEFAULT NULL COMMENT '包邮方式code',
  `offline` tinyint(1) DEFAULT '0' COMMENT '货到付款',
  `send_number` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '当不是实物时，是否已发货，0 ，否；1，是',
  `is_real` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否是实物，0，否；1，是；取值 ecs_goods',
  `extension_code` varchar(30) DEFAULT '' COMMENT '商品的扩展属性，比如像虚拟卡',
  `parent_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `is_gift` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT ' 是否参加优惠活动，0，否；1限时抢购  其他',
  `activity_id` int(20) DEFAULT '0' COMMENT '活动类型 0 无活动 1元嗨购 2..',
  `activity_status` varchar(20) DEFAULT '0' COMMENT '活动状态 a活动id未1 0 未出结果 1抢到 2未抢到  ',
  `order_type` tinyint(1) DEFAULT NULL COMMENT '订单类型 0未知 1店铺订单 2商品订单 3基地订单',
  `is_upgrade` tinyint(1) DEFAULT '0' COMMENT '升级产品',
  `activity_start_date` int(10) DEFAULT '0' COMMENT '促销价格开始日期',
  `activity_end_date` int(10) DEFAULT '0' COMMENT '促销价格结束日期',
  `goods_attr_id` varchar(255) NOT NULL DEFAULT '' COMMENT '商品属性',
  `is_refund` tinyint(1) DEFAULT '0' COMMENT '申请售后是否需要退货 1是 0否',
  `is_exchange` tinyint(1) DEFAULT '0' COMMENT '是否可换货1是 0否',
  `yes_refund` tinyint(1) DEFAULT '0' COMMENT '已退回 1是0否',
  `refund_time` int(10) DEFAULT '0' COMMENT '退回时间',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='订单的商品信息，注：订单的 商品信息基本都是从购物车所对应的';

