/*Table structure for table `db_g_order_goods_refund` */

DROP TABLE IF EXISTS `db_g_order_goods_refund`;

CREATE TABLE `db_g_order_goods_refund` (
  `ref_id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(10) DEFAULT '0' COMMENT '订单ideology',
  `order_goods_id` int(10) DEFAULT '0' COMMENT '订单商品iid',
  `member_id` int(10) DEFAULT '0' COMMENT '用户id ',
  `refund_name` varchar(20) DEFAULT NULL COMMENT '联系人',
  `refund_tel` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `refund_money` decimal(6,2) DEFAULT '0.00' COMMENT '退款金额',
  `refund_remark` varchar(255) DEFAULT NULL COMMENT '退货说明',
  `refund_img` varchar(255) DEFAULT NULL COMMENT '商品图片 多个用 ,  号隔开',
  `invoice_no_user` varchar(100) DEFAULT NULL COMMENT '用户发货单号，发货时填写，可在订单查询查看',
  `invoice_no_name` varchar(100) DEFAULT NULL COMMENT '快递名称',
  `user_send_img` varchar(100) DEFAULT NULL COMMENT '用户发货单图片',
  `user_send_time` int(10) DEFAULT '0' COMMENT '用户发货时间',
  `receipt_time` int(10) DEFAULT '0' COMMENT '收货时间',
  `invoice_no_shop` varchar(100) DEFAULT NULL COMMENT '商家发货单号，发货时填写，可在订单查询查看',
  `invoice_no_shop_name` varchar(100) DEFAULT NULL COMMENT '商家发货快递名称',
  `shop_remark` varchar(255) DEFAULT NULL COMMENT '商家备注',
  `shop_send_time` int(10) DEFAULT '0' COMMENT '商家发货时间',
  `send_address` varchar(255) DEFAULT NULL COMMENT '用户送货地址  收货人收货人电话等',
  `refund_status` tinyint(3) DEFAULT '0' COMMENT '0 待确认 1已确认 2 用户已发货 \r\n换货单 3商家已收货（待发货）  4商家已发货 5用户已收货(已完成) \r\n退货单 3商家已收货（待退款）  5已完成\r\n10商户拒绝\r\n',
  `refund_type` tinyint(4) DEFAULT '0' COMMENT '0换货 1退货',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`ref_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单商品 退货';

/*Data for the table `db_g_order_goods_refund` */

/*Table structure for table `db_g_order_info` */

DROP TABLE IF EXISTS `db_g_order_info`;

CREATE TABLE `db_g_order_info` (
  `order_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `pay_record_id` int(10) DEFAULT NULL COMMENT '支付记录ID',
  `order_sn` varchar(20) NOT NULL DEFAULT '' COMMENT '订单号，唯一',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `farm_id` mediumint(5) DEFAULT '0' COMMENT '基地保证金订单使用。基地id',
  `order_type` tinyint(1) DEFAULT '0' COMMENT '订单类型 0未知 1店铺订单 2商品订单 3基地订单',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态。0，未确认；1，已确 认；2，已取消；3，无效；4，退货；5,售后申请中',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品配送情况，0，未发货； 1，已发货；2，已收货；3，备货中',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT ' 支付状态；0，未付款；1，付款中 ；2，已付款',
  `is_gift` smallint(6) DEFAULT '0' COMMENT ' 是否参加优惠活动，0，否；1限时抢购  其他',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的姓名，用户页面填写，默认取值于表 user_address',
  `country` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的国家，用户页面填写，默认 取值于表user_address， ',
  `province` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的省份，用户页面填写，默 认取值于表user_address，',
  `city` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的城市，用户页面填写，默认取 值于表user_address',
  `district` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的地区，用户页面填写，默 认取值于表user_address',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '收货人的详细地址，用户页面填写，默认取值于表 user_address',
  `zipcode` varchar(60) DEFAULT '' COMMENT '收货人的邮编，用户页面填写，默认取值于表 user_address',
  `tel` varchar(60) DEFAULT '' COMMENT '收货人的电话，用户页面填写，默认取值于表user_address',
  `mobile` varchar(60) NOT NULL DEFAULT '' COMMENT ' 收货人的手机，用户页面填写，默认取值于表user_address',
  `email` varchar(60) DEFAULT '' COMMENT ' 收货人的邮箱，用户页面填写，默认取值于表user_address',
  `best_time` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的最佳送货时间，用户页面填写，默认取值于表 user_address',
  `sign_building` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的地址的标志性建筑，用户页面填写，默认取 值于表user_address',
  `is_sign_for` tinyint(1) DEFAULT '0' COMMENT '快递运输状态 0无状态 1已签收 2在途中 3问题件',
  `postscript` varchar(255) NOT NULL DEFAULT '' COMMENT '订单附言，由用户提交订单前填写',
  `shipping_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '用户选择的配送方式id取值表  shipping',
  `shipping_name` varchar(120) NOT NULL DEFAULT '' COMMENT '用户选择的配送方式的名称',
  `offline` tinyint(1) DEFAULT '0' COMMENT '货到付款',
  `offline_money` decimal(6,2) DEFAULT '0.00' COMMENT '余额支付金额',
  `pay_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '用户选择的支付方式的i',
  `pay_name` varchar(120) NOT NULL DEFAULT '' COMMENT '用户选择的支付方式的名称',
  `how_oos` varchar(120) NOT NULL DEFAULT '' COMMENT '缺货处理方式，等待所有商品备齐后再发； 取消订单；与 店主协商',
  `inv_payee` varchar(120) NOT NULL DEFAULT '' COMMENT '发票抬头，用户页面填写',
  `inv_content` varchar(120) NOT NULL DEFAULT '' COMMENT '发票内容，用户页面选择，取值ecs_shop_config的 code字段的值为invoice_content的value',
  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总金额',
  `is_rebate` tinyint(1) DEFAULT '0' COMMENT '是否已返利',
  `order_rebate` decimal(14,2) DEFAULT '0.00' COMMENT '订单返利积分值',
  `order_profit` decimal(14,2) DEFAULT '0.00' COMMENT '订单利润= 应付款金额-订单返利',
  `order_profit_all` decimal(14,2) DEFAULT '0.00' COMMENT '订单返利总金额 返利池',
  `profit_type` tinyint(1) DEFAULT '0' COMMENT '返利类型 1分享返利 0正常返利(123级返利)',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '配送费用',
  `insure_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '保价费用',
  `pay_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付费用,跟支付方式的配置相关',
  `money_paid` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已付款金额',
  `surplus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '该订单使用余额的数量，取用户设定余额 ，用户可用余额，订单金额中最小者',
  `wx_surplus` decimal(10,0) DEFAULT '0' COMMENT '微信支付金额',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分支付',
  `integral_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付的积分价值 金额',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '应付款金额',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `confirm_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单确认时间',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单支付时间',
  `shipping_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单配送时间',
  `finnshed_time` int(10) DEFAULT '0' COMMENT '完成时间',
  `invoice_no` varchar(255) NOT NULL DEFAULT '' COMMENT '发货单号，发货时填写，可在订单查询查看',
  `express_code` varchar(55) DEFAULT '' COMMENT '快递代码',
  `express_name` varchar(55) DEFAULT '' COMMENT '快递名称',
  `extension_code` varchar(30) NOT NULL DEFAULT '',
  `extension_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `to_buyer` varchar(255) NOT NULL DEFAULT '' COMMENT '商家给客户的留言,当该字段有值时可以在订单查询看到',
  `pay_note` varchar(255) NOT NULL DEFAULT '' COMMENT '付款备注，在订单管理里编辑修改',
  `agency_id` smallint(5) unsigned NOT NULL,
  `inv_type` varchar(60) NOT NULL COMMENT '发票类型，用户页面选择，取值ecs_shop_config的code字 段的值为invoice_type的value',
  `tax` decimal(10,2) NOT NULL COMMENT '发票税额',
  `parent_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `is_upgrade` tinyint(1) DEFAULT '0' COMMENT '升级产品',
  `discount_type` tinyint(3) DEFAULT '0' COMMENT '折扣类型 1 抽奖',
  `discount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '折扣金额',
  `discount_val` decimal(3,2) DEFAULT '0.00' COMMENT '折扣',
  `discount_start_time` int(10) DEFAULT '0' COMMENT '折扣开始时间',
  `discount_end_time` int(10) DEFAULT '0' COMMENT '折扣结束时间',
  `activity_id` int(20) DEFAULT '0' COMMENT '活动id 0表示没有活动',
  `activity_status` varchar(20) DEFAULT '0' COMMENT 'a,一元秒杀 0，未抢到 1，已抢到',
  `share_uid` int(10) DEFAULT NULL COMMENT '分享用户id',
  `user_del` tinyint(1) DEFAULT '0' COMMENT '用户是否删除 0否1是',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `order_status` (`order_status`),
  KEY `shipping_status` (`shipping_status`),
  KEY `pay_status` (`pay_status`),
  KEY `shipping_id` (`shipping_id`),
  KEY `pay_id` (`pay_id`),
  KEY `extension_code` (`extension_code`,`extension_id`),
  KEY `agency_id` (`agency_id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='订单的配送，贺卡等详细信息';

