/*Table structure for table `db_g_order_pay` */

DROP TABLE IF EXISTS `db_g_order_pay`;

CREATE TABLE `db_g_order_pay` (
  `pay_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_sn` varchar(20) NOT NULL COMMENT '支付单号',
  `order_sn` varchar(255) DEFAULT NULL COMMENT '订单号，多个订单号用‘,’隔开',
  `buyer_id` int(10) unsigned NOT NULL COMMENT '买家ID',
  `api_pay_state` enum('0','1') DEFAULT '0' COMMENT '0默认未支付1已支付(只有第三方支付接口通知到时才会更改此状态)',
  `add_time` int(20) DEFAULT NULL COMMENT '支付生成时间',
  `end_time` int(20) DEFAULT NULL COMMENT '支付结束时间',
  `total_money` decimal(12,2) DEFAULT NULL COMMENT '第三方支付总金额',
  `refund_money` decimal(12,2) DEFAULT NULL COMMENT '第三方支付退款金额',
  `trade_no` varchar(55) DEFAULT NULL COMMENT '交易号',
  PRIMARY KEY (`pay_id`)
