/*Table structure for table `db_g_order_refund` */

DROP TABLE IF EXISTS `db_g_order_refund`;

CREATE TABLE `db_g_order_refund` (
  `ref_id` int(11) NOT NULL AUTO_INCREMENT,
  `refund_sn` varchar(20) DEFAULT NULL COMMENT '退单号',
  `order_id` int(10) DEFAULT '0' COMMENT '订单ideology',
  `order_goods_id` int(10) DEFAULT '0' COMMENT '订单商品iid',
  `member_id` int(10) DEFAULT '0' COMMENT '用户id ',
  `refund_name` varchar(20) DEFAULT NULL COMMENT '联系人',
  `refund_tel` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `refund_points` decimal(13,2) DEFAULT '0.00' COMMENT '返还积分',
  `refund_money` decimal(12,2) DEFAULT '0.00' COMMENT '退款金额',
  `refund_wx` decimal(12,2) DEFAULT '0.00' COMMENT '微信退款',
  `refund_remark` varchar(255) DEFAULT NULL COMMENT '退货说明',
  `refund_img` varchar(255) DEFAULT NULL COMMENT '商品图片 多个用 ,  号隔开',
  `invoice_no_user` varchar(100) DEFAULT NULL COMMENT '用户发货单号，发货时填写，可在订单查询查看',
  `invoice_no_code` varchar(20) DEFAULT NULL COMMENT '用户退货快递公司代码',
  `invoice_no_name` varchar(100) DEFAULT NULL COMMENT '用户退货快递名称',
  `user_send_img` varchar(100) DEFAULT NULL COMMENT '用户发货单图片',
  `user_send_time` int(10) DEFAULT '0' COMMENT '用户发货时间',
  `receipt_time` int(10) DEFAULT '0' COMMENT '收货时间',
  `invoice_no_shop` varchar(100) DEFAULT NULL COMMENT '商家发货单号，发货时填写，可在订单查询查看',
  `invoice_no_shop_code` varchar(20) DEFAULT NULL COMMENT '商家发货快递公司代码',
  `invoice_no_shop_name` varchar(100) DEFAULT NULL COMMENT '商家发货快递名称',
  `shop_remark` varchar(255) DEFAULT NULL COMMENT '商家备注',
  `shop_send_time` int(10) DEFAULT '0' COMMENT '商家发货时间',
  `send_address` varchar(255) DEFAULT NULL COMMENT '用户送货地址  收货人收货人电话等',
  `refund_status` tinyint(3) DEFAULT '0' COMMENT '0 待确认 1已确认 2 用户已发货 \r\n换货单 3商家已收货（待发货）  4商家已发货 5用户已收货(已完成) \r\n退货单 3商家已收货（待退款）  5已完成\r\n10商户拒绝\r\n  6返款申请中',
  `return_goods` tinyint(3) DEFAULT '0' COMMENT '是否需要退货 0 不需要 1需要',
  `refund_type` tinyint(4) DEFAULT '0' COMMENT '0退货 1退款',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`ref_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单商品 退货';

/*Data for the table `db_g_order_refund` */

/*Table structure for table `db_g_order_refund_apply` */

DROP TABLE IF EXISTS `db_g_order_refund_apply`;

CREATE TABLE `db_g_order_refund_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `refund_id` int(11) DEFAULT NULL COMMENT '退单id',
  `order_id` int(11) DEFAULT NULL COMMENT '订单id',
  `member_id` int(11) DEFAULT NULL COMMENT '退单用户id',
  `total` decimal(13,2) DEFAULT '0.00' COMMENT '退单总额',
  `wx_refund` decimal(12,2) DEFAULT '0.00' COMMENT '退回微信钱包',
  `balance` decimal(12,2) DEFAULT '0.00' COMMENT '退回余额',
  `integral` int(11) DEFAULT '0' COMMENT '退回积分',
  `type` tinyint(2) DEFAULT '0' COMMENT '0,直接退款 1，先退货后退款',
  `status` tinyint(2) DEFAULT '0' COMMENT '0,未审核 ，1，同意返款 2，驳回',
  `add_time` int(20) DEFAULT NULL COMMENT '添加时间',
  `remarks1` varchar(200) DEFAULT NULL COMMENT '客服备注',
  `remarks` varchar(200) DEFAULT NULL COMMENT '拒绝理由',
  `wx_refund_id` varchar(30) DEFAULT NULL COMMENT '微信退款时微信交易号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

