/*Table structure for table `db_g_order_refund_chat` */

DROP TABLE IF EXISTS `db_g_order_refund_chat`;

CREATE TABLE `db_g_order_refund_chat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `refund_id` int(11) DEFAULT NULL COMMENT '退单id',
  `member_id` int(11) DEFAULT NULL COMMENT '申请售后用户id',
  `pid` int(11) DEFAULT '0' COMMENT '该对话上一句的id',
  `content` text COMMENT '对话内容',
  `img` varchar(255) DEFAULT NULL COMMENT '对话图片',
  `type` int(10) DEFAULT NULL COMMENT '1,用户，2，售后，',
  `log_orderstate` int(11) DEFAULT NULL COMMENT '0 待确认 1已确认 2 用户已发货 3商家已收货 4商家已发货 5用户已收货 6申请退款中 10拒绝',
  `add_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `is_read` tinyint(2) DEFAULT '0' COMMENT '是否已阅 0，未读 1，已读',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

