  `total_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '总金额',
  `new_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '今天奖池添加',
  `predict_draw` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '用于抽奖的金额',
