/*Table structure for table `db_member` */

DROP TABLE IF EXISTS `db_member`;

CREATE TABLE `db_member` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` char(32) DEFAULT NULL COMMENT '用户ID',
  `member_card` char(10) DEFAULT NULL COMMENT '会员卡号',
  `member_weixin` varchar(64) DEFAULT NULL COMMENT '用户微信号',
  `openid` char(32) DEFAULT NULL COMMENT 'openid',
  `is_guanzhu` tinyint(1) DEFAULT '0' COMMENT '是否已关注',
  `guanzhu_time` int(10) DEFAULT '0' COMMENT '关注时间',
  `is_update` tinyint(1) DEFAULT '0' COMMENT '是否更新微信信息 1是 0否',
  `member_name` varchar(30) DEFAULT NULL,
  `member_logo` varchar(200) DEFAULT '/Uploads/avatar_default.png' COMMENT '会员logo',
  `background_image` varchar(200) NOT NULL COMMENT '个人中心背景图',
  `real_name` varchar(30) DEFAULT NULL COMMENT '用户姓名(真实姓名)',
  `mobile` varchar(15) DEFAULT NULL COMMENT '手机号',
  `password` char(32) DEFAULT NULL COMMENT '密码',
  `my_recommend_code` char(10) DEFAULT NULL COMMENT '我的推荐码',
  `recommend_code` char(10) DEFAULT NULL COMMENT '推荐码 (推荐人的推荐码 )',
  `indirect_recommend_code` char(10) DEFAULT NULL COMMENT '间接推荐人推荐码 (推荐人的推荐人的推荐码 )',
  `indirect2_recommend_code` char(10) DEFAULT NULL COMMENT '间接2层推荐人推荐码 (推荐人的推荐人的推荐码 )',
  `member_type` tinyint(5) DEFAULT '0' COMMENT '会员类型 0 普通会员 1商户 2市级代理  3省级代理 4分公司 ',
  `member_status` tinyint(3) DEFAULT '0' COMMENT '认证情况 1 已认证 0未认证',
  `browsable_class` char(200) DEFAULT NULL COMMENT '用户可浏览的商品类别',
  `member_vip_type` tinyint(1) DEFAULT '0' COMMENT 'vip 0 普通会员  1 vip',
  `member_vip_order` tinyint(1) DEFAULT '0' COMMENT 'vip 完成订单  升级vip 是否有完成订单  ',
  `member_freeze` tinyint(3) DEFAULT '0' COMMENT '冻结情况  0未冻结  1已冻结',
  `freeze_end` int(11) DEFAULT '0' COMMENT '冻结结束时间',
  `shop_id` int(11) DEFAULT '0' COMMENT '商户会员关联后台商户id',
  `login_count` mediumint(8) DEFAULT '0' COMMENT '登录次数',
  `login_time` int(11) DEFAULT '0' COMMENT '当前登录时间',
  `login_ip` varchar(20) DEFAULT NULL COMMENT '当前登录IP',
  `last_login_time` int(11) DEFAULT '0' COMMENT '上次登录时间',
  `last_login_ip` varchar(20) DEFAULT NULL COMMENT '上次登录ip',
  `add_time` int(11) DEFAULT '0' COMMENT '注册时间',
  `vip_time` int(10) DEFAULT '0' COMMENT '升级vip时间',
  `today_page_view` int(10) NOT NULL DEFAULT '0' COMMENT '通过分享日访问量',
  `month_page_view` int(10) NOT NULL DEFAULT '0' COMMENT '通过分享月访问量',
  `total_page_view` int(10) NOT NULL DEFAULT '0' COMMENT '通过分享总访问量',
  `access_time` int(11) NOT NULL DEFAULT '0' COMMENT '通过分享月访问时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_tb_member_07` (`id`),
  UNIQUE KEY `idx_tb_member_02` (`member_card`),
  UNIQUE KEY `idx_tb_member_03` (`mobile`),
  KEY `idx_tb_member_06` (`add_time`),
  KEY `idx_tb_member_05` (`member_freeze`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员信息表';

