  `recommends` int(11) DEFAULT '0' COMMENT '推荐人数',
  `indirects` int(11) DEFAULT '0' COMMENT '间接推荐人数',
  `points` decimal(12,2) DEFAULT '0.00' COMMENT '积分数',
  `present_points` decimal(12,2) DEFAULT '0.00' COMMENT '关注赠送积分数',
  `balance` decimal(12,2) DEFAULT '0.00' COMMENT '余额',
