  PRIMARY KEY (`id`),
  KEY `idx_tb_member_detail_u_01` (`member_id`),
  KEY `idx_tb_member_detail_u_03` (`balance`) USING BTREE,
  KEY `idx_tb_member_detail_u_04` (`points`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员详细信息';

