/*Table structure for table `db_member_level` */

DROP TABLE IF EXISTS `db_member_level`;

CREATE TABLE `db_member_level` (
  `levelId` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键 自增',
  `levelName` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '等级名称(标准店   高级店   旗舰店.....)',
  `price` decimal(10,0) DEFAULT NULL COMMENT '价格',
  `award_standard` decimal(10,0) DEFAULT NULL COMMENT '推荐标准店奖金',
  `award_senior` decimal(10,0) DEFAULT NULL COMMENT '高级店奖金',
  `sale_self` decimal(10,0) DEFAULT NULL COMMENT '自营店铺销售奖金百分比',
  `sale_child` decimal(10,0) DEFAULT NULL COMMENT '旗下连锁店铺销售奖金百分比',
  `sale_child2` int(3) DEFAULT NULL COMMENT '(旗舰店才有)旗下二级店铺盈利的返利百分比(所有旗下非一级店铺都是二级店铺)',
  `addChild2` decimal(10,0) DEFAULT NULL COMMENT '增加二级连锁店获取奖金',
  `upgrade_price` decimal(10,0) DEFAULT NULL COMMENT '升级价格',
