  `upgrade_parm2` int(11) DEFAULT NULL COMMENT '升级参数2',
  `isShow` int(11) DEFAULT NULL COMMENT '是否显示(0 否 1  是)',
  `comment` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`levelId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='会员等级表';

