/*Table structure for table `db_member_recharge` */

DROP TABLE IF EXISTS `db_member_recharge`;

CREATE TABLE `db_member_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录ID 32位',
  `order_id` bigint(18) DEFAULT NULL,
  `order_sn` bigint(18) DEFAULT '0' COMMENT '流水号  线上支付流水号',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '商户会员id',
  `shop_id` int(11) DEFAULT '0',
  `money` decimal(14,2) DEFAULT NULL COMMENT '应收金额',
  `type` tinyint(3) DEFAULT '0' COMMENT '类型 1会员充值 2商户充值',
  `status` tinyint(3) DEFAULT '1' COMMENT '0已退款 1 待支付 2已支付 3支付失败',
