  `admin_name` varchar(32) DEFAULT NULL COMMENT '操作员姓名',
  `des` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_tb_recharge_member_01` (`member_id`) USING BTREE,
  KEY `idx_tb_recharge_member_02` (`add_time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='普通会员充值记录';

